export default {

	moveSerialised: () => {
		if (MoveSubLotToShipment.data.errors != null) {
			showAlert(MoveSubLotToShipment.data.errors[0].message)
		} 
	},
	moveCarrier: () => {
		if (MoveTrackedByCarrierToShipment.data.errors != null) {
			showAlert(MoveTrackedByCarrierToShipment.data.errors[0].message)
		} else {
			UpdateShipmentItemMaterial.run()
			closeModal("AddItemsModal")
			showModal("WeighItemsModal")
		}
	}, 
	moveUntracked: () => {
		if (MoveUntrackedToShipment.data.errors != null) {
			showAlert(MoveUntrackedToShipment.data.errors[0].message)
		} else {
			UpdateShipmentItemMaterial.run()
			closeModal("AddItemsModal")
			showModal("WeighItemsModal")
		}
	},
	createAUSPostLabel: () => {
		if (CreateAUSPostLabel.data.errors != null) {
			showAlert(CreateAUSPostLabel.data.errors[0].message)
		} else {
			showModal("ShipmentLabelModal")
		}
	},
	createAUSPostOrder: () => {
		if (CreateAUSPostOrder.data.errors != null) {
			showAlert(CreateAUSPostOrder.data.errors[0].message)
		} else {
			closeModal("CreateDeliveryModal")
		}
	},
	createAUSPostShipmentItemLabel: () => {
		if (CreateAUSPostShipmentItemLabel.data.errors != null) {
			showAlert(CreateAUSPostShipmentItemLabel.data.errors[0].message)
		}
	},
	updateAUSPostShipmentItem: () => {
		if (UpdateAUSPostShipmentItem.data.errors != null) {
			showAlert(UpdateAUSPostShipmentItem.data.errors[0].message)
		}
	},
	addShipmentItems: () => {
		if (AddShipItems.data.errors != null) {
			showAlert(AddShipItems.data.errors[0].message)
		} else {
			closeModal('ParcelDetail')
			GetOrderDetail.run()
		}
	},
	updateShipmentItemMaterial: () => {
		if (UpdateShipmentItemMaterial.data.errors != null) {
			showAlert(UpdateShipmentItemMaterial.data.errors[0].message)
		} else {
			closeModal('AddItemsModal')
			showModal('WeighItemsModal')
		}
	}
}
